import React from 'react';
import { BrowserRouter, Routes , Route, Header } from 'react-router-dom'



function App() {
  return (
    <BrowserRouter>
    <div>
        <Header/>  
        <Routes>
          <Route path='/' ></Route>
          <Route path='/' ></Route>
        </Routes>    
    </div>
    </BrowserRouter>
  );
}

export default App;
